// src/components/Hemose/RecRedirecionamento.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../../styles/styles.css';     // CSS global (ajuste se estiver noutro lugar)

export default function RecRedirecionamento() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [modalDados, setModalDados] = useState(false);
  const [modalDir, setModalDir] = useState(false);

  return (
    <div className="container">
      {/* Sidebar fixa */}
      <aside className="sidebar-fixed-left">
        <div className="logo-container-fixed">
          <img src="/fsph_logo.png" alt="Logo FSPH" className="logo-fundo-saude" />
        </div>

        <nav className="menu-navegacao-esquerda">
          <h2 className="menu-navegacao-titulo">2. Recepção</h2>
          <ul>
            <li><Link to="#">2.1 Lista de Pacientes</Link></li>
            <li><Link to="#">2.2 Agendamentos</Link></li>
          </ul>
        </nav>
      </aside>

      {/* Conteúdo principal */}
      <main className="main-content">
        <header className="main-header">
          <h1>Recepção e Redirecionamento</h1>
          <button
            className="hamburger-button"
            onClick={() => setMenuOpen(prev => !prev)}
          >
            <img src="/menu_hamburger.png" alt="Menu" />
          </button>
        </header>

        <section className="form-cadastro-container">
          <p>💡 Aqui você renderiza busca de pacientes e tabela.</p>
          <button
            className="submit-button-main"
            onClick={() => setModalDados(true)}
          >
            Abrir Modal Dados
          </button>
        </section>
      </main>

      {/* Modal: Dados do paciente */}
      {modalDados && (
        <div className="modal-fsph">
          <div className="modal-fsph-content">
            <span className="modal-fsph-close" onClick={() => setModalDados(false)}>
              &times;
            </span>
            <h2>Dados do Paciente</h2>
            <p>Detalhes…</p>
          </div>
        </div>
      )}

      {/* Modal: Direcionar paciente */}
      {modalDir && (
        <div className="modal-fsph">
          <div className="modal-fsph-content">
            <span className="modal-fsph-close" onClick={() => setModalDir(false)}>
              &times;
            </span>
            <h2>Direcionar Paciente</h2>
            <p>Aqui vai o formulário de direcionamento…</p>
          </div>
        </div>
      )}

      {/* Popup-menu lateral */}
      <aside className={`popup-menu-right ${menuOpen ? 'open' : ''}`}>
        <ul>
          <li><Link to="#"><img src="/icons/cadastros.png" alt="Cadastros" /> Cadastros</Link></li>
          <li><Link to="/recepcao"><img src="/icons/recepcao.png" alt="Recepção" /> Recepção</Link></li>
          <li><Link to="/evo-ambulatorio"><img src="/icons/ambulatorio.png" alt="Ambulatório" /> Ambulatório</Link></li>
          <li><Link to="#"><img src="/icons/laboratorio.png" alt="Laboratório" /> Laboratório</Link></li>
        </ul>
        <ul>
          <li><Link to="/login"><img src="/icons/logout_icon.png" alt="Sair" /> Sair</Link></li>
        </ul>
      </aside>

      {/* Overlay para fechar o popup quando clicado fora */}
      {menuOpen && (
        <div
          className="modal-fsph-overlay"
          onClick={() => setMenuOpen(false)}
        ></div>
      )}
    </div>
  );
}
